import React from "react";

export default function Header() {
  return (
    // {/* <header className="main-header">
    //   <div></div>
    //   <h1>Rise Up</h1>
    // </header> */}
    <div className="bg-nude-100 h-full lg:min-h-screen p-0 w-min lg:w-full">
      <div>
        <title>Tiffany Chan | Web Developer</title>
      </div>

      {/* NAV BAR */}
      <div className="flex sticky top-0 left-0 justify-between h-20 bg-nude-200">
        <div>
          <h1 className="text-white font-default italic m-4 text-5xl">
            Tiffany Chan
          </h1>
        </div>
        <div className="text-white flex justify-center mt-7 mr-6  font-default italic text-xl">
          <Link href="/about">
            <a className="text-white mr-9 hover:text-nude-500">About</a>
          </Link>
          <Link href="/work">
            <a className="text-white mr-9 hover:text-nude-500">Work</a>
          </Link>
          <Link href="/contact">
            <a className="text-white mr-12 hover:text-nude-500">Contact</a>
          </Link>
        </div>
      </div>
    </div>
  );
}
